script: |
  super -f text -I q8890.spq | sort > q8890.out

inputs:
  - name: q8890.spq
    data: |
      SELECT DISTINCT - col2, 8 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 <= - col1 * - col0 + + - col0;
  - name: tab1

outputs:
  - name: q8890.out
    data: |
      -59	8
      -68	8
      -96	8
